#define _vbx_acc(VMODE,VINSTR,DEST,SRCA,SRCB)        vbx_acc_##VMODE(VINSTR,DEST,SRCA,SRCB)
#define _vbx_masked_acc(VMODE,VINSTR,DEST,SRCA,SRCB) vbx_masked_acc_##VMODE(VINSTR,DEST,SRCA,SRCB)
